import { ReactComponent as Check } from './check.svg';
import { ReactComponent as Delete } from './delete.svg';

const iconTypes = {
    "check": <Check className='Icon-svg' />,
    "delete": <Delete />,
};

function TodoIcon({ type }) {
    return (
        <span className={`Icon-container Icon-container-${type}`}
        >
            {iconTypes[type]}            
        </span>
    );
}

export { TodoIcon };
